/**
 * Assert whether a ASF_ASFTestEquation is any of the valid alternatives, or not. This analysis does not go any deeper than the top level
 * \param[in] arg input ASF_ASFTestEquation
 * \return ATtrue if #arg corresponds to the expected signature, or ATfalse otherwise
 */
ATbool ASF_isValidASFTestEquation(ASF_ASFTestEquation arg) {
  if (ASF_isASFTestEquationSimple(arg)) {
    return ATtrue;
  }
  else if (ASF_isASFTestEquationImplies(arg)) {
    return ATtrue;
  }
  else if (ASF_isASFTestEquationWhen(arg)) {
    return ATtrue;
  }
  return ATfalse;
}

